import Link from "next/link";
import ProfilePic from "../images/IMG_2955_Original.JPG";

const LandingHeader = () => (
  <div className="landing">
    <section id="intro">
      <h1>Woo Young Choi</h1>
      <p>Software engineer based in New York, NY.</p>
      <p>Specializing in building and designing websites and applications.</p>
    </section>
    <section id="about">
      <div id="picture">
        <a href="https://github.com/wc356">
          <div>
            <img src={ProfilePic} alt="profile picture"></img>
          </div>
        </a>
      </div>
      <div id="bio"></div>
    </section>
    <style jsx>
      {`
        .landing {
          align-items: center;
          display: flex;
          flex-direction: column;
          font-family: "Futura";
          justify-content: center;
          min-height: 100vh;
          text-align: center;
        }

        h1 {
          color: #3366cc;
          font-size: 50px;
          font-weight: 600;
        }

        p {
          color: #3366cc;
          font-size: 18px;
        }
      `}
    </style>
  </div>
);

export default LandingHeader;
